import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import {  Route, createBrowserRouter, createRoutesFromElements, RouterProvider } from 'react-router-dom';

import Login from './Login';
import Signup from './Signup';
import MyButton from './MyButton';
import ThankYou from './ThankYou';
import Createproj from './Createproj'
import TeamName from './TeamName'
import Viewpage from './Viewpage'
import Viewproj from './Viewproj'
import CreateTeamRoster from './CreateTeamRoster';
import UserStory from './Userstory';
import WelcomUser from './WelcomUser';

const root = ReactDOM.createRoot(document.getElementById('root'));

const router = createBrowserRouter(
  createRoutesFromElements(
    <>
     <Route path="/" element={<WelcomUser />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path = "/createProject" element = {<Createproj/>}/>
          <Route path = "/createTeam" element = {<TeamName/>}/>
          <Route path="/ThankYou" element={<ThankYou />} />
          <Route path="/s" element={<Login />} />
          <Route path="/MyButton" element={<MyButton />} />
          <Route path="/Viewpage" element={<Viewpage />} />
          <Route path="/viewAllProjects" element={<Viewproj />} />
          <Route path="/createTeamRoster" element={<CreateTeamRoster />} />
          <Route path="/UserStory" element={<UserStory />} />
          <Route path="/WelcomUser" element={<WelcomUser />} />

    </>
  )
)
root.render(
  <React.StrictMode>
    <RouterProvider router = {router}>
    <App />
    </RouterProvider>
  </React.StrictMode>
);

reportWebVitals();
